    "/boracay/member/front/user/bulletin/list":"{\"code\":0,\"msg\":null,\"data\":[{\"bulletinId\":\"169\",\"type\":1,\"title\":\"12.3原品牌\",\"context\":\"<p>12.3原品牌</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-12-03 11:29:01\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"166\",\"type\":1,\"title\":\"其他大厅红点\",\"context\":\"<p>其他大厅红点111</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-11-18 16:53:53\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"165\",\"type\":1,\"title\":\"分隔符干饭干饭1\",\"context\":\"<p>c</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-11-14 12:10:05\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"164\",\"type\":1,\"title\":\"新公告\",\"context\":\"<p>三国攻秦，入函谷。秦王谓楼缓曰：“三国之兵深矣，寡人欲割河东而讲。”对曰：“割河东，大费也；免于国患，大利也。此父兄之任也。王何不召公子池而问焉?”</p><p>　　王召公子池而问焉，对曰：“讲亦悔，不讲亦悔。”王曰：“何也?”对曰：“王割河东而讲，三国虽去，王必曰：‘惜矣!三国且去，吾特以三城从之。’此讲之悔也。王不讲，三国入函谷，咸阳必危，王又曰：‘惜矣!吾爱三城而不讲。’此又不讲之悔也。”王曰：“钧吾悔也，宁亡三城而悔，无危咸阳而悔也。寡人决讲矣。”卒使公子池以三城讲于三国，之兵乃退。</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-11-13 13:58:01\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"163\",\"type\":1,\"title\":\"㐳wer0i\",\"context\":\"<p>认为二位</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-11-03 15:46:05\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"162\",\"type\":1,\"title\":\"㐳wer0i\",\"context\":\"<p>认为二位</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-11-03 15:46:05\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"161\",\"type\":1,\"title\":\"㐳wer0i\",\"context\":\"<p>认为二位</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-11-03 15:46:05\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"160\",\"type\":1,\"title\":\"㐳wer0i\",\"context\":\"<p>认为二位</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-11-03 15:46:05\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"159\",\"type\":1,\"title\":\"㐳wer0i\",\"context\":\"<p>认为二位</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-11-03 15:46:05\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"158\",\"type\":1,\"title\":\"㐳wer0i\",\"context\":\"<p>认为二位</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-11-03 15:46:05\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"157\",\"type\":1,\"title\":\"热污染\",\"context\":\"<p>热污染</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-10-30 15:30:45\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"156\",\"type\":1,\"title\":\"😁温柔温柔\",\"context\":\"<p>😁认为二位二&nbsp;</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-10-30 14:28:05\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"153\",\"type\":1,\"title\":\"test\",\"context\":\"<p>2023-10-22 07:00:00 CS2 - Punto Gamers Cup（Furious Gaming VS River Plate Gaming）, because（River Plate Gaming）teams player forfeited, all bets involved are considered invalid, Parlay counted as (1), Kindly double-check your statement again. We apologize for any inconvenience caused!</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-10-22 15:08:23\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"152\",\"type\":1,\"title\":\"1111\",\"context\":\"<p>1111</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-10-21 15:38:07\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"151\",\"type\":1,\"title\":\"1111\",\"context\":\"<p>1111</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-10-21 15:36:57\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"150\",\"type\":1,\"title\":\"通知\",\"context\":\"<h3>紧急通知</h3><p>关于英雄联盟赛事结算问题的说明2023-10-20 06 : 46 : 17</p><p>关于我方电竞英雄联盟赛事的结算问题，将优先以实时视频及实时赛后数据统计面板为依据进行结算，在没有以上赛事依据的情况下，辅以下方网站数据做为结算依据，特此明！ <a href=\\\"https://lol.fandom.com/wiki/League_of_Legends_Esports_Wiki\\\">https://lol.fandom.com/wiki/League_of_Legends_Esports_Wiki</a></p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-10-20 17:53:21\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"149\",\"type\":1,\"title\":\"梦游天姥吟留别\",\"context\":\"<p>海客谈瀛洲，烟涛微茫信难求；<br>越人语天姥，云霞明灭或可睹。<br>天姥连天向天横，势拔五岳掩赤城。<br>天台四万八千丈，对此欲倒东南倾。</p><p>我欲因之梦吴越，一夜飞度镜湖月。<br>湖月照我影，送我至剡溪。<br>谢公宿处今尚在，渌水荡漾清猿啼。<br>脚著谢公屐，身登青云梯。<br>半壁见海日，空中闻天鸡。<br>千岩万转路不定，迷花倚石忽已暝。<br>熊咆龙吟殷岩泉，栗深林兮惊层巅。<br>云青青兮欲雨，水澹澹兮生烟。<br>列缺霹雳，丘峦崩摧。<br>洞天石扉，訇然中开。<br>青冥浩荡不见底，日月照耀金银台。<br>霓为衣兮风为马，云之君兮纷纷而来下。<br>虎鼓瑟兮鸾回车，仙之人兮列如麻。<br>忽魂悸以魄动，恍惊起而长嗟。<br>惟觉时之枕席，失向来之烟霞。</p><p>世间行乐亦如此，古来万事东流水。<br>别君去兮何时还？且放白鹿青崖间，须行即骑访名山。<br>安能摧眉折腰事权贵，使我不得开心颜！</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-10-17 15:25:15\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"148\",\"type\":1,\"title\":\"定风波·莫听穿林打叶声\",\"context\":\"<p>三月七日，沙湖道中遇雨，雨具先去，同行皆狼狈，余独不觉。已而遂晴，故作此。</p><p>莫听穿林打叶声，何妨吟啸且徐行。竹杖芒鞋轻胜马，谁怕？一蓑烟雨任平生。<br>料峭春风吹酒醒，微冷，山头斜照却相迎。回首向来萧瑟处，归去，也无风雨也无晴。</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-10-17 11:24:39\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"147\",\"type\":1,\"title\":\"孟子\",\"context\":\"<p>梁惠王曰：“寡人之于国也，尽心焉耳矣。河内凶，则移其民于河东，移其粟于河内。河东凶亦然。察邻国之政，无如寡人之用心者。邻国之民不加少，寡人之民不加多，何也？”</p><p>孟子对曰：“王好战，请以战喻。填然鼓之，兵刃既接，弃甲曳兵而走。或百步而后止，或五十步而后止。以五十步笑百步，则何如？”</p><p>曰：“不可，直不百步耳，是亦走也。”</p><p>曰：“王如知此，则无望民之多于邻国也。不违农时，谷不可胜食也；数罟不入洿池，鱼鼈不可胜食也；斧斤以时入山林，材木不可胜用也。谷与鱼鼈不可胜食，材木不可胜用，是使民养生丧死无憾也。养生丧死无憾，王道之始也。五亩之宅，树之以桑，五十者可以衣帛矣；鸡豚狗彘之畜，无失其时，七十者可以食肉矣；百亩之田，勿夺其时，数口之家可以无饥矣；谨庠序之教，申之以孝悌之义，颁白者不负戴于道路矣。七十者衣帛食肉，黎民不饥不寒，然而不王者，未之有也。</p><p>狗彘食人食而不知检，涂有饿莩而不知发；人死，则曰：‘非我也，岁也。’是何异于刺人而杀之，曰：‘非我也，兵也。’王无罪岁，斯天下之民至焉。”</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-10-15 18:51:29\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"146\",\"type\":1,\"title\":\"1431\",\"context\":\"<p>13123</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-10-15 18:45:38\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"145\",\"type\":1,\"title\":\"app测试测试\",\"context\":\"<p>哈哈哈#￥‘“’</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-10-15 18:44:47\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"144\",\"type\":1,\"title\":\"rodan\",\"context\":\"<p>rodan111111</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-07-18 14:53:43\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"143\",\"type\":1,\"title\":\"d反对法\",\"context\":\"<p>士大夫方法</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-02-12 15:49:43\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"142\",\"type\":1,\"title\":\"测试公告1\",\"context\":\"<p>测试公告1</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-01-13 17:47:31\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"141\",\"type\":1,\"title\":\"11\",\"context\":\"<p>111</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-01-11 13:15:26\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"138\",\"type\":2,\"title\":\"维护-简体\",\"context\":\"<p>维护-简体</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-01-11 13:13:57\",\"createdBy\":\"\",\"read\":null},{\"bulletinId\":\"132\",\"type\":1,\"title\":\"测试公告简体\",\"context\":\"<p>测试公告简体</p>\",\"bulletinType\":\"2\",\"status\":2,\"createdAt\":\"2023-01-11 13:13:26\",\"createdBy\":\"\",\"read\":null}],\"total\":27,\"sucess\":true}",
